import React, { Component } from 'react';
import Navbar from 'react-bootstrap/Navbar';

const Nav_Bar = (props) => {
  return (
    <Navbar bg="light" variant="dark">
      <Navbar.Brand>Logo</Navbar.Brand>
    </Navbar>
  );
};

export default Nav_Bar;
